    const { onCloseModal, isVisible, setIsVisible } = props;

    return (
        <Modal onCloseModal={onCloseModal} isVisible={isVisible} setIsVisible={setIsVisible} className={'mb-32'}>
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

CreateConfigurationModal.propTypes = {};

export default CreateConfigurationModal;
